import React from 'react';
import {motion} from 'framer-motion';
import ScrollAnimation from "react-animate-on-scroll";

const PageLearn = () => {
  return (
    <div className=''>
      <ScrollAnimation animateIn='hinge' delay={1000} duration={4000}>
      <h1 className='titleLearn'>How it works</h1>
      </ScrollAnimation>
    </div>
  );
}

export default PageLearn;
